    NO SQL
begin

SET @vpro_id = vProducto_id;

IF @vpro_id = 0 THEN
	IF (select count(*) from productos where codigobarras like vProductoCodigoBarras) > 0 then
    	SET @vpro_id = (select id from productos where codigobarras like vProductoCodigoBarras);
        update productos set nombre = vProductoNombre , departamento = vProductoDepartamento , agranel = vProductoAgranel where id = @vpro_id  ; 
    ELSE
    	insert into productos ( codigobarras, nombre , departamento, agranel  ) 
    	values (vProductoCodigoBarras, vProductoNombre ,vProductoDepartamento , vProductoAgranel );
    	SET @vpro_id = (SELECT id from productos WHERE codigobarras like vProductoCodigoBarras);
    END if;
