     `ajustePositivo`, `ajusteNegativo`, 
     `ventaCantidad`, `ventaPrecio`, `ventaTotal`, 
     `usuario_id`) VALUES 
    ( vsucursal_id , vterminal_id , @vpro_id , 
      0.000, 0.000 , 0.000 , 
	 vInventarioPrecio, vInventarioMayoreo, 
	 vInventarioExistencia, vInventarioMinimo,
	  0.000, 0.000 ,
	  0.000, 0.00 , 0.00 ,
	  vUsuario_id );
