CREATE DEFINER=`root`@`%` PROCEDURE `ventas_detail`(IN `vSucursalId` INT, IN `vTerminalId` INT, IN `vUsuarioId` INT, IN `vVentaId` INT, IN `vInventarioId` INT, IN `vProductoId` INT, IN `vVentaCantidad` DECIMAL(10,3), IN `vVentaPrecio` DECIMAL(10,2), IN `vVentaTotal` DECIMAL(10,2))
    NO SQL
begin 

INSERT INTO `ventas_details`
	(`sucursal_id`, `terminal_id`, `usuario_id`, `venta_id`, `producto_id`, `inventario_id`, 
     `venta_cantidad`, `venta_precio`, `venta_total`) 
     VALUES 
     ( vSucursalId , vTerminalId , vUsuarioId , vVentaId , vProductoId , vInventarioId,
      vVentaCantidad, vVentaPrecio , vVentaTotal );

