CREATE DEFINER=`root`@`%` PROCEDURE `ventas_init`(IN `vSucursalId` INT, IN `vTerminalId` INT, IN `vUsuaioId` INT, IN `vVentaTotal` DECIMAL(10,2), IN `vEfectivo` DECIMAL(10,2), IN `vCambio` DECIMAL(10,2), OUT `vVentaId` INT)
    NO SQL
begin 

UPDATE `folios` SET `valor`=`valor`+1 WHERE `id` = 1;
SET @folio = (select `valor` from `folios` WHERE `id` = 1);


INSERT INTO 
    `ventas_index`(`sucursal_id`, `terminal_id`, `usuario_id`, `folio`, `total`, `efectivo`, `cambio`)
VALUES 
    (vSucursalId,vTerminalId,vUsuaioId, @folio ,vVentaTotal , vEfectivo , vCambio);

SET vVentaId = LAST_INSERT_ID();
SELECT vVentaId;

end ;;
